import React, { Component, useState } from "react";
import './professor-marvin.css';
import UploadService from "./services/upload-files.service";

export default class ProfessorMarvin extends Component {
    constructor(props) {
        super(props);    
        this.state = {
          selectedFiles: undefined,
          currentFile: undefined,
          progress: 0,
          delay: 0,
          messages: [],
          user_message: 'Type a message...'
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
      }

    delay = ms => new Promise(res => setTimeout(res, ms));

    onDrop = (files) => {
        if (files.length > 0) {
          this.setState({ selectedFiles: files });
        }
    }
    componentDidMount = () => {
        UploadService.getFiles().then((files) => {
          this.setState({
            fileInfos: files.data['data'],
          });
        });
    }

    upload = async () => {
        let currentFile = this.state.selectedFiles[0];

        this.setState({
          progress: 0,
          currentFile: currentFile,
        });

        await UploadService.upload(currentFile)
          .then((response) => {
            this.setState({
              message: response.message,
            });

            if (response.already_exists) {
              this.setState({
                delay: 0,
                progress: 0
              });
            }
            else {
              this.setState({
                delay: 500,
                progress: 100
              });
            }

            return UploadService.getFiles();
          })
          .then((files) => {
            this.setState({
              fileInfos: files.data['data'],
            });

          })
          .catch(() => {
            console.log('failed');
            this.setState({
              progress: 0,
              delay: 0,
              message: "ERROR: File is not a PDF",
              currentFile: undefined,
            });
          });

        await this.delay(this.state.delay);
        this.setState({
          selectedFiles: undefined,
          progress: 0,
        });

    }

    clearMessages = async () => {
      await UploadService.clearMessages()
        .then((response) => {
          this.setState({
            message: response.message,
          });
          return UploadService.getMessages();
        })
        .then((message_list) => {
          this.setState({
            messages: message_list.data['messages'],
          });
        })
        .catch(() => {
          this.setState({
            message: "ERROR: Unable to delete all messages",
          });
        });
    }

    handleChange(event) {
      this.setState({user_message: event.target.value});
    }

    handleSubmit = async () => {
      await UploadService.sendMessage(this.state.user_message)
      .then((response) => {
        return UploadService.getMessages();
      })
      .then((message_list) => {
        console.log(message_list);
        console.log(message_list.data);
        this.setState({
          messages: message_list.data['messages'],
        });
      })
      .catch(() => {
        this.setState({
          message: "ERROR: Unable to delete all messages",
        });
      });
    }



    render() {    
        const { messages } = this.state;
        return (
          <div>

            <aside>
              <div className="card message-box">
                <table className="table-border">
                  <thead className="header">
                    <tr><td colSpan="3" >&nbsp;&nbsp;&nbsp;Professor Marvin</td></tr>
                  </thead>
                  <tbody className="body">
                    <tr><td><div className="box-marvin">I'm speech bubble I'm speech bubble I'm speech bubble</div></td><td><div className="box-user">3</div></td></tr>
                    <tr><td><div className="box-marvin">I'm speech bubbleI'm speech bubbleI'm speech bubbleI'm speech bubbleI'm speech bubble</div></td><td></td></tr>
                    <tr><td></td><td><div className="box-user">3</div></td></tr>
                    <tr className="user-messages"><td>2</td></tr>
                    {messages.map((currMessage) => (
                        <tr key={currMessage.index}><td><div className="box-marvin">{currMessage.message.content}</div></td><td></td></tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </aside>

            <aside>
              <div className="messages-input-div">
                <input onChange={this.handleChange} className="messages-input-field" type="text"/>‍
                <button onClick={this.handleSubmit} className="messages-input-button">Send!</button>
              </div>
            </aside>


            <aside>
              <br></br>
              <a href="/upload_page">
                <button 
                  className="btn btn-go-to-upload">
                  &lt; Edit Files
                </button>
              </a>
            </aside>

            <aside className="selected-file-wrapper">
              <br></br>
              <button 
                className="btn btn-delete-all"
                onClick={this.clearMessages}>
                Clear All Messages
              </button>
            </aside>
          </div>
        );
    }    
}
